(self.webpackChunktil=self.webpackChunktil||[]).push([[2058],{6963:(e,l,i)=>{"use strict";i.r(l),i.d(l,{default:()=>a});const r=(0,i(6252).uE)('<h1 id="_202105-rrr"><a class="header-anchor" href="#_202105-rrr">#</a> 202105 RRR</h1><h2 id="review"><a class="header-anchor" href="#review">#</a> Review</h2><ul><li>deno 메뉴얼 메모</li><li>포스팅 <ul><li><code>chmod</code></li><li>rest api basic</li><li>oak</li></ul></li></ul><h2 id="reflect"><a class="header-anchor" href="#reflect">#</a> Reflect</h2><ul><li>Deno 메뉴얼을 보는 것이 도움이 안되는 것은 아니나, <code>실질적인 개발에 도움이 적다.</code><ul><li>예를 들면, 현재 oak framework를 이용하여 카페 쿠폰매니저를 개발/유지보수하고 있으나 그 과정에서 Deno 메뉴얼이 도움이 되었던 경우는 적다. 비교적 새로운 기술인만큼 정독하며 세세한 부분까지 습득하고 싶었지만 어떤 내용이 있는지만 머리에 넣어두고 찾는 게 편할 듯하다.</li><li>무엇이 도움이 될지 모르니 prioritize 가 잘 안되었다.</li></ul></li><li>전체적으로 학습의 질이 떨어지는 달이다. <code>일상생활을 조정</code>할 필요가 있다.</li><li>저번달에 끝내기로 계획한 걸 못끝냈다ㅠㅠ 다음주내로 하자.</li><li>memo 임을 잊지말자. <code>내용</code>이 중요한 것이지 <code>번역</code>에 너무 많은 시간을 쏟을 필요는 없다.</li><li>다음 달 내에 주제를 마무리 지어야 할 것들 <ul><li>google web fundamentals</li><li>deno</li><li>mocha, chai</li></ul></li></ul><h2 id="rearrange"><a class="header-anchor" href="#rearrange">#</a> Rearrange</h2><ul><li>일정한 시간대에 til을 하고 커밋하자.</li></ul>',7),a={render:function(e,l){return r}}},2886:(e,l,i)=>{"use strict";i.r(l),i.d(l,{data:()=>r});const r={key:"v-354430d9",path:"/review/202105.html",title:"202105 RRR",lang:"ko-KR",frontmatter:{},excerpt:"",headers:[{level:2,title:"Review",slug:"review",children:[]},{level:2,title:"Reflect",slug:"reflect",children:[]},{level:2,title:"Rearrange",slug:"rearrange",children:[]}],filePathRelative:"review/202105.md",git:{updatedTime:1622461864e3}}}}]);